// Followers.jsx
import React from 'react';

const Followers = ({ followers }) => (
  <div>
    <h3>Followers</h3>
    <ul>
      {followers.map(follower => (
        <li key={follower.id}>
          <a href={`/user/${follower.id}`}>{follower.name}</a>
        </li>
      ))}
    </ul>
  </div>
);

export default Followers;
